    false,nt"url": null,nt"notes": "This data layer is a compilation of all
    of the coastal flood elevation data available from the published Flood Insurance
    Studies for the California coast.The data was assembled by county and community
    for all California coastal communities where Flood Insurance Studies (FIS) are published.
    For counties where updated DFIRM's were available, the FIS was not examined and
    no data was added. The points were digitized over USGS 7.5-minute Topo Maps based
    on the descriptions of the transects given in the FIS.",nt"license_title":
